		<Stack
			gap={10}
			overflow={'auto'}
			flexBasis={`1px`}
			flexGrow={1}
		>
			<Stack
				display={'flex'}
				sx={{
					width: '100%',
				}}
			>
				<Stack>
					<Stack
						gap={`10%`}
						flexDirection={'row'}
					>
						<Stack
							flexBasis={`100%`}
							gap={2}
							sx={{
								'& table': {
									borderCollapse: 'separate',
									borderSpacing: `0 4px`,
								},
								'& tr': {
									verticalAlign: 'top',
								},
								'& .tdValue': {
									paddingLeft: 2,
								},
							}}
						>
							<PoppinsTypography
								variant='subtitle1'
								sx={{ color: theme.palette.common.primaryGreyText }}
								fontWeight={600}
							>
								Other Details
							</PoppinsTypography>
							<DetailsTable
								data={[
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`Complete Address  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.other_details?.address}
											</PoppinsTypography>
										),
										showWhen: true,
									},
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`Type  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.other_details?.restaurant_type}
											</PoppinsTypography>
										),
										showWhen: true,
									},
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`Cuisine  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.other_details?.cuisine}
											</PoppinsTypography>
										),
										showWhen: true,
									},
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`QR Assigned  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
