											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.owner_details.owner_email}
											</PoppinsTypography>
										),
										showWhen: true,
									},
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`Agreement Type  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.owner_details?.agreement_type}
											</PoppinsTypography>
										),
										showWhen: true,
									},
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`Agreed Percentage  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.owner_details?.agreed_percentage}
											</PoppinsTypography>
										),
										showWhen: true,
									},
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{
														color: theme.palette.common.primaryGreyText,
														textTransform: 'uppercase',
													}}
												>{`Active Discount  `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													fontWeight={600}
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: isToUpdate ? (
											<InputField
												showLabel={false}
												fieldName='offer_list'
												value={formData?.offer_list ?? ''}
												fieldProps={{
													color: 'secondary',
													fullWidth: true,
													sx: {
														'.MuiOutlinedInput-input': {
															paddingY: 1,
														},
														'.MuiInputBase-input': {
															height: 15,
															fontSize: 14,
														},
													},
													error: Boolean(formError.offer_list),
													helperText: formError.offer_list,
												}}
												onChange={onChange}
											/>
										) : (
											<PoppinsTypography
												variant='subtitle1'
												sx={{ color: theme.palette.common.primaryGreyText }}
											>
												{details?.other_details.offer_list}
											</PoppinsTypography>
										),
										showWhen: true,
									},
								]}
							/>
						</Stack>

						<Stack
							flexBasis={`100%`}
							gap={2}
							sx={{
								'& table': {
									borderCollapse: 'separate',
									borderSpacing: `0 4px`,
								},
								'& .tdValue': {
									paddingLeft: 2,
								},
								'& tr': {
									verticalAlign: 'top',
								},
							}}
						>
							<PoppinsTypography
								variant='subtitle1'
								sx={{ color: theme.palette.common.primaryGreyText }}
								fontWeight={600}
							>
								Documents Details
							</PoppinsTypography>
							<DetailsTable
								data={[
									{
										name: (
											<Stack
												flexDirection={'row'}
												justifyContent={'space-between'}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`FSSAI Licence `}</PoppinsTypography>
												<PoppinsTypography
													variant='subtitle1'
													sx={{ color: theme.palette.common.secondaryGreyText }}
												>{`:`}</PoppinsTypography>
											</Stack>
										),
										value: (
											<Stack
												sx={{
													flexDirection: 'row',
													justifyContent: 'space-between',
													gap: 1,
												}}
											>
												<PoppinsTypography
													variant='subtitle1'
													sx={{
														color: theme.palette.primary.main,
														paddingLeft: 1,
														cursor: 'pointer',
														'&:hover': {
															textDecoration: 'underline',
														},
													}}
													onClick={() =>
														setViewInfo({
															render: (
																<Uploader
																	fieldName='fassi'
																	file={details?.document_details?.fssai_lic_no_url_pic ?? ''}
																/>
															),
															heading: `FSSAI License`,
															type: 'FSSAI Licence',
															disableAccept:
																details?.document_details?.fssai_status === '1' ||
																details?.document_details?.fssai_status === '2',
															disableReject:
																details?.document_details?.fssai_status === '1' ||
																details?.document_details?.fssai_status === '2',
															//		showDone: !(details?.other_details.status === '0'),
														})
													}
												>
													{details?.document_details?.fssai_lic_no}
